const Certification = () => {
  return (
    <div className="bg-white shadow-lg shadow-white-500/50 rounded-sm mt-3 ml-3 text-black text-center">
    <div className='text-xl font-medium flex'>
    <p className='ml-3 mt-3'>Certification</p>
  </div>    
    </div>
  )
}

export default Certification
